import React from 'react'

function ProgressBar({completed}) {
  return (
    <div className='h-5 w-full bg-gray-33 rouned-full my-12'>
        <div className='h-full bg-green-500 rounded-full text-right' style={{width:`${completed}`}}>
            <span className='text-white font-bold text-xs pr-2'>`${completed}</span>
        </div>
    </div>
  )
}

export default ProgressBar
